  \"2016-11-24T09:06:42.416059\",\n\t\"name\": \"ems-incident-dispatch-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The EMS Incident Dispatch Data file contains
  data that is generated by the EMS Computer Aided Dispatch System. The data spans
  from the time the incident is created in the system to the time the incident is
  closed in the system.  It covers information about the incident as it relates to
  the assignment of resources and the Fire Departmentu2019s response to the emergency.
  To protect personal identifying information in accordance with the Health Insurance
  Portability and Accountability Act (HIPAA), specific locations of incidents are
  not included and have been aggregated to a higher level of detail.\",\n\t\"license_title\":
